import MapComponent from './Map/MapComponent.js';
export class Home extends React.Component{

    render(){
        return( 
        <div>   
            {this.state.checked ? (
            <div id="bar">
                    <SearchBar></SearchBar>   
            </div>
            
        ) : (
            <div id="map">    
                  <MapComponent></MapComponent>  
               
            </div>
            )}

        );
        </div>
           
        );
    }

}
